import React, { FC, useState, useEffect } from 'react';
import axios from "axios";
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import { CardCarWrapper } from './CardCar.styled';
import ListGroup from 'react-bootstrap/ListGroup';

interface CardCarProps {
   vin: string,
   img: string,
   wanted: boolean,
   brand: string,
   model: string,
   modelyear: string,
   region: string,
}

const CardCar: FC<CardCarProps> = ({img, vin, wanted, brand, model, modelyear, region}) => (
 <CardCarWrapper>
    <Card style={{ width: '18rem', backgroundColor: '#E3E8EB'}}>
      <Card.Img variant="top" src={img} />
      <Card.Body >
        <Card.Title>{brand} </Card.Title>
        <Card.Text>
        {model} {modelyear}
        </Card.Text>
      </Card.Body>
      <ListGroup className="list-group-flush"  >
        <ListGroup.Item style= {{backgroundColor: '#E3E8EB'}}> {wanted ? 'В розыске' : 'Не в розыске'}</ListGroup.Item>
        <ListGroup.Item style={{backgroundColor: '#E3E8EB'}}>Vin: {vin}</ListGroup.Item>
        <ListGroup.Item style={{backgroundColor: '#E3E8EB'}}>Регион: {region}</ListGroup.Item>

      </ListGroup>

    </Card>
 </CardCarWrapper>
);

export default CardCar;
